INSERT INTO `temp`.`tmp_sec_fixedmodel` (`theme`, `level`, `sortorder`, `status`, `displayname`, `description`, `lowRisk`, `highRisk`, `expectedreturn`, `expectedrisk`, `taxable`) VALUES ('0.BB', 'S2', '2', 'A', 'Conservative Balanced', 'Conservative Balanced – clients typically have a low tolerance for risk, and a moderate desire for cash flow from the portfolio.  Their total return expectations are modest.  The investment time horizon will tend to be moderate (five to ten years).  The client will accept the risk of nominal principal fluctuations to the extent needed in order to preserve purchasing power.', '24', '44', '0.0634', '0.060', '');
INSERT INTO `temp`.`tmp_sec_fixedmodel` (`theme`, `level`, `sortorder`, `status`, `displayname`, `description`, `lowRisk`, `highRisk`, `expectedreturn`, `expectedrisk`, `taxable`) VALUES ('0.BB', 'S3', '3', 'A', 'Balanced Return', 'Balanced Return – clients typically have a moderate tolerance for risk, and a modest desire for some cash flow from the portfolio.  Their return expectations are realistic in that they will accept long term returns less than that as achieved by the equity markets.  The investment time horizon will tend to be moderate (ten to twenty years).  The client will accept risk to grow the portfolio in modest excess over inflation.', '44', '60', '0.0668', '0.070', '');
INSERT INTO `temp`.`tmp_sec_fixedmodel` (`theme`, `level`, `sortorder`, `status`, `displayname`, `description`, `lowRisk`, `highRisk`, `expectedreturn`, `expectedrisk`, `taxable`) VALUES ('0.BB', 'S4', '4', 'A', 'Balanced Opportunity', 'Balanced Opportunity – clients typically have a moderate long term tolerance for risk but an above average tolerance for short-term risk, and a limited desire for cash flow from the portfolio.  Their return expectations are high and consistent with long term equity market performance.  The fixed income portion of their allocation is more to provide stability rather than income.  The investment time horizon will tend to be long (ten years or generational).  The client will accept risk to grow the portfolio in excess of inflation.', '60', '80', '0.0697', '0.081', '');
